func (obj modelRoleFeatures) Query() *Query {
	query := new(Query)
	var elapseMs int
	for {
		collectionRoleFeaturesMutex.RLock()
		bootstrapped := GoCoreRoleFeaturesHasBootStrapped
		collectionRoleFeaturesMutex.RUnlock()

		if bootstrapped {
			break
		}
		elapseMs = elapseMs + 2
		time.Sleep(time.Millisecond * 2)
		if elapseMs%10000 == 0 {
			log.Println("RoleFeatures has not bootstrapped and has yet to get a collection pointer")
		}
	}
	query.collectionName = "RoleFeatures"
	query.entityName = "RoleFeature"
	return query
}
