func (self *RoleFeature) Save() error {
	if self.Id == "" {
		self.Id = bson.NewObjectId()
	}
	t := time.Now()
	self.CreateDate = t
	self.UpdateDate = t
	dbServices.CollectionCache{}.Remove("RoleFeatures", self.Id.Hex())
	return dbServices.BoltDB.Save(self)
}

